    "You can also try to use the Autocreate-Function to chose an existing device from the iobroker-object-tree. Autocreate tries to find out the role and to match as many states as possible.": {"en": "You can also try to use the Autocreate-Function to chose an existing device from the iobroker-object-tree. Autocreate tries to find out the role and to match as many states as possible.", "de": "Sie können auch versuchen, die Autocreate-Funktion zu wählen, ein vorhandenes Gerät aus der iobroker-Objekt-Baum. Autocreate versucht, um herauszufinden, die Rolle und Spiel so viele Staaten wie möglich.", "ru": "Вы также можете попробовать использовать Автосоздание-функция, чтобы выбрать существующее устройство из iobroker-объект-Дерево. Автосоздание пытается выяснить роль и, чтобы соответствовать как можно больше государств.", "pt": "Você também pode tentar usar o Autocreate-Função para seleccionar um dispositivo existente a partir do iobroker-objeto-árvore. Autocreate tenta descobrir o papel e para corresponder ao maior número possível de estados.", "nl": "U kunt ook proberen om het gebruik van de Autocreate-Functie te kiezen een bestaand apparaat van de iobroker-object-boom. Autocreate probeert te vinden van de rol en overeenkomen met zoveel mogelijk lidstaten.", "fr": "Vous pouvez également essayer d'utiliser la Autocreate-Fonction d'choisi un appareil de la iobroker-objet-arbre. Autocreate essaie de trouver le rôle et correspondent à autant d'états que possible.", "it": "Si può anche provare a utilizzare il Autocreate-Funzione di scegliere un dispositivo esistente dal iobroker-oggetto-albero. Autocreate cerca di scoprire il ruolo e di corrispondere il maggior numero possibile di stati.", "es": "Usted también puede tratar de usar el Autocreate la Función de elegir un dispositivo existente de la iobroker-objeto-árbol. Autocreate trata de averiguar el papel y para que coincida con el mayor número de estados posible.", "pl": "Możesz także spróbować skorzystać z automatycznym generowaniem-opcja, aby wybrać istniejące urządzenie z iobroker-obiekt-Drzewo. Z automatycznym generowaniem stara się wyjaśnić rolę i, aby dopasować jak najwięcej państw.", "zh-cn": "您也可以尝试使用的自动创建功能。该功能将尝试匹配ioBroker的对象并创建设备。"},
